-- ----------------------------
-- Table structure for `zs_permit`
-- ----------------------------
DROP TABLE IF EXISTS `zs_permit`;
CREATE TABLE `zs_permit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `applicantname` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '申请公司名称',
  `applicantaddress` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '申请公司地址',
  `code` char(100) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '邮政编码',
  `customername` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户姓名',
  `customermobile` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户手机号',
