-- ----------------------------
-- Table structure for `zs_service`
-- ----------------------------
DROP TABLE IF EXISTS `zs_service`;
CREATE TABLE `zs_service` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `service_name` varchar(255) DEFAULT '' COMMENT '服务名称',
  `price_large` float(11,2) DEFAULT '0.00' COMMENT '大类官费',
  `price_small` float(11,2) DEFAULT '0.00' COMMENT '小类官费',
  `price_service` float(11,2) DEFAULT '0.00' COMMENT '服务费',
  `price_market` float(11,2) DEFAULT '0.00' COMMENT '市场价',
  `describe` text COMMENT '商品描述',
  `type` int(11) DEFAULT NULL COMMENT '类型 1注册2转让3许可4变更5驳回6异议7续展',
  `state` int(11) DEFAULT '0' COMMENT '状态  0上架 1下架',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

