-- ----------------------------
-- Table structure for `zs_user`
-- ----------------------------
DROP TABLE IF EXISTS `zs_user`;
CREATE TABLE `zs_user` (
  `id` int(11) NOT NULL COMMENT '用户id',
  `imgPath` varchar(255) DEFAULT '' COMMENT '头像',
  `loginName` varchar(255) DEFAULT '' COMMENT '用户名',
  `phone` varchar(255) DEFAULT '' COMMENT '手机号',
  `email` varchar(255) DEFAULT '' COMMENT '邮箱',
  `kyjf` int(11) DEFAULT '0' COMMENT '可用积分',
  `djjf` int(11) DEFAULT '0' COMMENT '冻结积分',
  `lsdjjf` int(11) DEFAULT '0' COMMENT '历史冻结积分',
  `ljxfjf` int(11) DEFAULT '0' COMMENT '累计消费积分',
  `companyName` varchar(255) DEFAULT '' COMMENT '企业',
  `linkMan` varchar(255) DEFAULT '' COMMENT '联系人',
  `isClaimed` int(1) DEFAULT '0' COMMENT '是否认领0未认领 1已认领',
  `chasum` int(11) DEFAULT '0' COMMENT '查询商标的次数',
  `adviser` int(1) DEFAULT '0' COMMENT '1有顾问0没有',
  `address` varchar(255) DEFAULT '' COMMENT '联系人地址',
  `emailBindFlag` int(1) DEFAULT NULL COMMENT '邮箱绑定标识 0未绑定 1已绑定',
  `phoneBindFlag` int(1) DEFAULT NULL COMMENT '手机绑定标识 0未绑定 1已绑定',
  `safetyLevel` int(1) DEFAULT NULL COMMENT '安全级别“低级1”“中级2”“高级3”',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户信息表';

-- ----------------------------
-- Records of zs_user
-- ----------------------------

-- ----------------------------
-- Table structure for `zs_users`
-- ----------------------------
DROP TABLE IF EXISTS `zs_users`;
CREATE TABLE `zs_users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_login` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `user_nicename` varchar(50) NOT NULL DEFAULT '' COMMENT '用户美名',
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '登录邮箱',
  `user_url` varchar(100) NOT NULL DEFAULT '' COMMENT '用户个人网站',
  `avatar` varchar(255) DEFAULT NULL COMMENT '用户头像，相对于upload/avatar目录',
  `sex` smallint(1) DEFAULT '0' COMMENT '性别；0：保密，1：男；2：女',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `signature` varchar(255) DEFAULT NULL COMMENT '个性签名',
  `last_login_ip` varchar(16) DEFAULT NULL COMMENT '最后登录ip',
  `last_login_time` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '最后登录时间',
  `create_time` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '注册时间',
  `user_activation_key` varchar(60) NOT NULL DEFAULT '' COMMENT '激活码',
  `user_status` int(11) NOT NULL DEFAULT '1' COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '用户积分',
  `user_type` smallint(1) DEFAULT '1' COMMENT '用户类型，1:admin ;2:会员',
  `coin` int(11) NOT NULL DEFAULT '0' COMMENT '金币',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  PRIMARY KEY (`id`),
  KEY `user_login_key` (`user_login`),
  KEY `user_nicename` (`user_nicename`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of zs_users
-- ----------------------------

