-- Table structure for `zs_zcorder`
-- ----------------------------
DROP TABLE IF EXISTS `zs_zcorder`;
CREATE TABLE `zs_zcorder` (
  `orderid` int(11) NOT NULL AUTO_INCREMENT,
  `customerid` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户id',
  `query_no` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '查询单id',
  `applicantname` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '申请公司名称',
  `applicantaddress` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '申请公司地址',
  `type` int(1) DEFAULT NULL COMMENT '订单类型1注册',
  `official_price` int(11) DEFAULT '0' COMMENT '官费',
  `service_price` int(11) DEFAULT '0' COMMENT '服务费',
  `summary_price` int(11) DEFAULT '0' COMMENT '总计费用',
  `actual_price` int(11) DEFAULT '0' COMMENT '实际支付',
  `state` int(1) DEFAULT '0' COMMENT '订单状态0未支付1已支付2取消3完成4失败',
  `order_no` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customername` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户姓名',
  `customermobile` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户手机号',
  `one_code` text COLLATE utf8_unicode_ci COMMENT '一级类',
  `addtime` int(11) DEFAULT NULL COMMENT '下单时间',
  `paytime` int(11) DEFAULT NULL COMMENT '支付时间',
  `mark_state` int(2) DEFAULT NULL,
  `markid` text COLLATE utf8_unicode_ci COMMENT '商标id多个id以单后分割',
  `porder` int(11) DEFAULT NULL COMMENT '父级订单的id',
  PRIMARY KEY (`orderid`)
) ENGINE=MyISAM AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

